import React, { useState } from 'react';
import GroceryList from './GroceryList';
import Car from './Car';
import Phone from './Phone';
import SweetsList from './SweetsList';
import Electronics from './Electronics';
import CanteenMenu from './CanteenMenu';
import JuiceList from './JuiceList';

function App() {
  const [lab, setLab] = useState('');

  const groceries = ['Rice', 'Wheat', 'Sugar', 'Milk', 'Oil'];

  return (
    <div className="App">
      <h1>React Labs Project</h1>

      {/* Button Menu */}
      <button onClick={() => setLab('lab1')}>Lab 1 - GroceryList</button>
      <button onClick={() => setLab('lab2')}>Lab 2 - Car Component</button>
      <button onClick={() => setLab('lab3')}>Lab 3 - Phone</button>
      <button onClick={() => setLab('lab4')}>Lab 4 - Sweets List</button>
      <button onClick={() => setLab('lab5')}>Lab 5 - Electronics</button>
      <button onClick={() => setLab('lab6')}>Lab 6 - Canteen Menu</button>
      <button onClick={() => setLab('lab7')}>Lab 7 - Juice List</button>

      <br /><br />

      {/* Conditional Rendering */}
      {lab === 'lab1' && <GroceryList items={groceries} />}
      {lab === 'lab2' && <Car brand="Toyota" model="Fortuner" color="Black" year="2022" />}
      {lab === 'lab3' && <Phone />}
      {lab === 'lab4' && <SweetsList />}
      {lab === 'lab5' && <Electronics />}
      {lab === 'lab6' && <CanteenMenu />}
      {lab === 'lab7' && <JuiceList />}
    </div>
  );
}

export default App;
